export const setDefaultsforLocalStorage = () => {
  UserStore.setLocalStorageItem('userDetails', userDetails);
  UserStore.setLocalStorageItem('activeLocation', userDetails.locationId);
  UserStore.setLocalStorageItem('activeLocale', userDetails.languageCode);
  UserStore.setLocalStorageItem('entities', userDetails.rights);
};

export const setDefaultRights = async () => {
  const locationId = 1; // for UACE
  const moduleId = 6; // for CAR
  const url = RoleApi.GET_ENTITY_RIGHTS.concat(
    `locationId=${locationId}&moduleId=${moduleId}`
  );
  const response = await axios.get(url);
  if (response.data.status === 200) {
    UserStore.setLocalStorageItem('entities', response.data.payLoad);
  }
};
